import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import PublicMapView from "./PublicMapView";
import OfficeDashboard from "./OfficeDashboard";
import Login from "./Login";
import Signup from "./SignUp";
import axios from "axios";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [user, setUser] = useState(null);
  const [view, setView] = useState("public"); // 'public' or 'dashboard'

  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (storedUser) {
      setIsLoggedIn(true);
      setUser(JSON.parse(storedUser));
    }
  }, []);

  const handleLogin = (userData) => {
    localStorage.setItem("user", JSON.stringify(userData));
    setIsLoggedIn(true);
    setUser(userData);
    setView("dashboard");
  };

  const handleLogout = () => {
    localStorage.removeItem("user");
    setIsLoggedIn(false);
    setUser(null);
    setView("public");
  };

  return (
    <Router>
      <div>
        <nav>
          <h1>Live Dental Office Availability</h1>
          <button onClick={() => setView(view === "public" ? "dashboard" : "public")}>
            {view === "public" ? "Go to Dashboard" : "Go to Public View"}
          </button>
          {isLoggedIn ? (
            <button onClick={handleLogout}>Logout</button>
          ) : (
            <>
              <Link to="/login">Login</Link>
              <Link to="/signup">Sign Up</Link>
            </>
          )}
        </nav>

        <Routes>
          <Route path="/" element={view === "public" ? <PublicMapView /> : <OfficeDashboard user={user} />} />
          <Route path="/login" element={<Login onLogin={handleLogin} />} />
          <Route path="/signup" element={<Signup />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
